        /// <summary>
        /// Iterate over all the class instances referenced from this instance
        /// without further recursion.
        /// </summary>
        public IEnumerable<IClass> DescendOnce()
        {
            if (Extensions != null)
            {
                foreach (var anItem in Extensions)
                {
                    yield return anItem;
                }
            }

            if (DisplayName != null)
            {
                yield return DisplayName;
            }

            if (Description != null)
            {
                yield return Description;
            }

            if (SemanticId != null)
            {
                yield return SemanticId;
            }

            if (DataSpecifications != null)
            {
                foreach (var anItem in DataSpecifications)
                {
                    yield return anItem;
                }
            }

            if (ContainedElements != null)
            {
                foreach (var anItem in ContainedElements)
                {
                    yield return anItem;
                }
            }
        }

        /// <summary>
        /// Iterate recursively over all the class instances referenced from this instance.
        /// </summary>
        public IEnumerable<IClass> Descend()
        {
            if (Extensions != null)
            {
                foreach (var anItem in Extensions)
                {
                    yield return anItem;

                    // Recurse
                    foreach (var anotherItem in anItem.Descend())
                    {
                        yield return anotherItem;
                    }
                }
            }

            if (DisplayName != null)
            {
                yield return DisplayName;

                // Recurse
                foreach (var anItem in DisplayName.Descend())
                {
                    yield return anItem;
                }
            }

            if (Description != null)
            {
                yield return Description;

                // Recurse
                foreach (var anItem in Description.Descend())
                {
                    yield return anItem;
                }
            }

            if (SemanticId != null)
            {
                yield return SemanticId;

                // Recurse
                foreach (var anItem in SemanticId.Descend())
                {
                    yield return anItem;
                }
            }

            if (DataSpecifications != null)
            {
                foreach (var anItem in DataSpecifications)
                {
                    yield return anItem;

                    // Recurse
                    foreach (var anotherItem in anItem.Descend())
                    {
                        yield return anotherItem;
                    }
                }
            }

            if (ContainedElements != null)
            {
                foreach (var anItem in ContainedElements)
                {
                    yield return anItem;

                    // Recurse
                    foreach (var anotherItem in anItem.Descend())
                    {
                        yield return anotherItem;
                    }
                }
            }
